    assert(getUsernameCloudErrorUnknow != null);
    assert(usernameAlreadyInUse != null);
    assert(fbOperationInProgress != null);
    return fbOperationInProgress(this);
  }

  @override
  @optionalTypeArgs
  TResult maybeMap<TResult extends Object>({
    TResult cancelledByUser(CancelledByUser value),
    TResult serverError(ServerError value),
    TResult emailAlreadyInUse(EmailAlreadyInUse value),
    TResult invalidEmailAndPasswordCombination(
        InvalidEmailAndPasswordCombination value),
    TResult insufficientPermission(InsufficientPermission value),
    TResult unableToGetEmail(UnableToGetEmail value),
    TResult unexpected(Unexpected value),
    TResult saveUserError(SaveUserError value),
    TResult metodoInicioDeSesionNoDisponible(
        MetodoInicioDeSesionNoDisponible value),
    TResult getUsernameCloudServerError(GetUsernameCloudServerError value),
    TResult getUsernameCloudErrorUnknow(GetUsernameCloudErrorUnknow value),
    TResult usernameAlreadyInUse(UsernameAlreadyInUse value),
    TResult fbOperationInProgress(FbOperationInProgress value),
    @required TResult orElse(),
  }) {
    assert(orElse != null);
    if (fbOperationInProgress != null) {
      return fbOperationInProgress(this);
    }
    return orElse();
  }
}

abstract class FbOperationInProgress implements AuthFailure {
  const factory FbOperationInProgress() = _$FbOperationInProgress;
}
